//static const trit_t zeros[STATE_LENGTH];
CLCurl *curl;
trit_t trits[STATE_LENGTH];


static int init_suite_curl(void) {
	curl = malloc(sizeof(CLCurl));
	return 0;
}
static int clean_suite_curl(void) {
	free(curl);
	return 0;
}

static void ccurl_test_setup(void) {
	memset(trits,0, sizeof(trit_t) * STATE_LENGTH);
	memset(curl,0, sizeof(CLCurl));
	init_clcurl(curl);
	return;
}

static void ccurl_test_teardown(void) {
	clcurl_destroy(curl);
	return;
}

static void test_clcurl_squeeze(void) {

	memcpy(trits, trits_in_2, sizeof(trit_t)*length);
	for(int i=0; i<3; i++) {
		cl_absorb(curl, trits, length, i*HASH_LENGTH, HASH_LENGTH);
	}
	cl_squeeze(curl, trits, length, 0, length);
	CU_ASSERT(memcmp(trits, trits_in_2, STATE_LENGTH * sizeof(long)) != 0);
	CU_ASSERT(memcmp(trits, trits_out_2, STATE_LENGTH * sizeof(long)) == 0);

	memcpy(trits, trits_in1_1, length * sizeof(long));
	CU_ASSERT(memcmp(trits, trits_in1_1, STATE_LENGTH * sizeof(long)) == 0);

	cl_reset(curl);
	cl_absorb(curl, trits, length, HASH_LENGTH, HASH_LENGTH);
	cl_squeeze(curl, trits, length, 0, length);

	CU_ASSERT(memcmp(trits, trits_out1_1, length * sizeof(long)) == 0);
}

static void test_clcurl_abs_squeeze(void) {

	memcpy(trits, trits_2, length * sizeof(long));

	cl_absorb(curl, trits,length,0,length);
	cl_squeeze(curl, trits,length,0,length);
	CU_ASSERT(memcmp(trits, expect_2, length * sizeof(long)) == 0);

	cl_reset(curl);
	memcpy(trits, trits_2, length * sizeof(long));

	cl_absorb(curl, trits,length,0,length);
	cl_squeeze(curl, trits,length,0,length);
	CU_ASSERT(memcmp(trits, expect_2, length * sizeof(long)) == 0);
}

static void test_clcurl_reset(void) {
	size_t offset = 0;

	memcpy(trits, trits_in_1, sizeof(trit_t)*length);

	cl_absorb(curl, trits, length, offset, length);
	cl_squeeze(curl, trits, length, offset, length);
	cl_reset(curl);
	offset = 0;
	memcpy(trits, trits_in_1, sizeof(trit_t)*length);
	cl_absorb(curl, trits, length, offset, length);
	cl_squeeze(curl, trits, length, offset, length);
	CU_ASSERT(memcmp(trits,trits_out_1,sizeof(trit_t)*length) == 0);
}

static CU_TestInfo tests[] = {
	{"Test CL Curl Squeeze", test_clcurl_squeeze},
	{"Test CL Loop Abs/Sqz", test_clcurl_abs_squeeze},
	{"Test CL Curl Reset", test_clcurl_reset},
	CU_TEST_INFO_NULL,
};

static CU_SuiteInfo suites[] = {
	{ "CL Curl Suite", init_suite_curl, clean_suite_curl, ccurl_test_setup, ccurl_test_teardown, tests },
	CU_SUITE_INFO_NULL,
};

ADD_SUITE(suites);
